import s from "./MyPosts.module.css";

const MyPosts = () => {
  return (
    <div>
      My posts
      <div>
        <textarea></textarea>
        <button>Add post</button>
        <div className={s.posts}>
          <div className={s.item}>
            <img src="https://avatars.mds.yandex.net/get-kino-vod-films-gallery/28788/47e2fd514411e18b76af786d7417062d/100x64_3" />
            Post 1
          </div>
          <div className={s.item}>Post 2</div>
          <div className={s.item}>Post 3</div>
          <div className={s.item}>Post 4</div>
          <div className={s.item}>Post 5</div>
          <div className={s.item}>Post 6</div>
        </div>
      </div>
    </div>
  );
};
export default MyPosts;
